import i18n from "i18next";
import Backend from "-xhr-backendi18next";
import { initReactI18next } from "react-i18next";



i18next
    .use(Backend)
    .init({
        langs: ['en', 'pl'],
        fallbackLng: 'en',
        load: "all",
        whitelist: ["pl", "en"],
        debug: false
    });

export default i18n;
